pragma solidity ^0.6.0;

contract SimpleStroage {
    uint256 public favNumber;
    /*im at 1:43:29 */
    // public means anyone can call  it
    // external means it has to be called from a different contract (!)
    function store(uint _favNumber) public {
        favNumber = _favNumber;
    }

    // view, pure dont actaully make a transaction 
    function retrieve_view() public view returns(uint256) {
        return favNumber;
    }

    // pure function just do some math, doesnt return, only view returns
    function favoriteNumber_pure(uint256 anotherNumber) public pure {
        anotherNumber + anotherNumber;
    }

        // pure function just do some math, doesnt return, only view returns
    function favoriteNumber_view(uint256 anotherNumber) public view returns(uint256) {
        return anotherNumber + favNumber;
    }
}
